import React from "react";

const HistoricoDividendos = () => {
  return (
    <div className="historico-container">
      <h2>Histórico de Dividendos</h2>
      <p>Em breve serão exibidos gráficos e dados sobre dividendos.</p>
    </div>
  );
};

export default HistoricoDividendos;
